import React from 'react';
import {
Nav,
NavLink,
Bars,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavbarElements';

const Navbar = () => {
return (
	<>
	<Nav>
		{/* <Bars /> */}

		<NavMenu>
		<NavLink to='/solution' activeStyle>
			Solution
		</NavLink>
		<NavLink to='/question' activeStyle>
			Question
		</NavLink>

		{/* Second Nav */}
		</NavMenu>
		<NavBtn>
			<NavBtnLink to='/signin'>Sign In</NavBtnLink>
			<NavBtnLink to='/login'>Login</NavBtnLink>
		</NavBtn>
	</Nav>
	</>
);
};

export default Navbar;
